import React from 'react'
import ReactDOM from 'react-dom'

const timeNow = new Date()
const hour = timeNow.getHours()
if(hour>=0 && hour <12){
    greet = 'morning'
}
else if (hour>=12 && hour <6){
    greet = "afternoon"
}
else{
    greet = 'evening'
}
ReactDOM.render(
    <>
    <h1>Good {greet}</h1>
    </>,

    document.getElementById('root')
)
